import { useState } from 'react';
import { Navigate, useNavigate } from 'react-router-dom';


function StartPage(){



  let navigate = useNavigate();



  const generateKey = () => {
    const url = '' 
    let key = '';
    const possible = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    for (let i = 0; i < 5; i++) {
      key += possible.charAt(Math.floor(Math.random() * possible.length));
    }
    return key;
  };


  function starthandleClick(){

    const newKey = generateKey();
    localStorage.setItem('userID','something')
    navigate(`game/${newKey}`);
  }


  const fetchRoomData = async (roomId) => {
    return fetch(`http://localhost:3001/game/data/${roomId}`)
    .then(response => {
      if (!response.ok){
        throw new Error(`HTTP error! status : ${response.status}`);
      }
      return response.json();
    })  
    .catch(e => {
      console.error('There was a problem with your fetch operation ' + e.message);
    });
  }




return (
  <div>

    <h1> Psychic! </h1>

    <div>

    <button onClick={starthandleClick}>
      <h2> Start New Game !</h2>
    </button> 
    </div>


 </div>


);

}
export default StartPage;
